import React from 'react'
import {Routes, Route, Navigate} from 'react-router-dom'
import Home from "./../pages/Home";
import Tours from "./../pages/Tours";
import ToursDetails from "./../pages/ToursDetails";
import Login from "./../pages/Login";
import Register from "./../pages/Register";
import Search from "./../pages/Search";


const routers = () => {
  return (
    <Routes>
        <Route path="/" element={<Navigate to='/home' />} />
        <Route path="/home" element={<Home />} />
        <Route path="/tours" element={<Navigate to='/Tours' />} />
        <Route path="/tours/:id" element={<Navigate to='/ToursDetails' />} />
        <Route path="/login" element={<Navigate to='/Login' />} />
        <Route path="/register" element={<Navigate to='/Register' />} />
        <Route path="/tours/search" element={<Navigate to='/Search' />} />
    </Routes>
  )
}

export default routers
